import './App.css';
import Conteudo from './conteudos/Conteudo';
import Form from './conteudos/Form';
import Rodape from './conteudos/Rodape';
<link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.5.0/css/font-awesome.min.css"></link>


function App() {
  return (
    <div className="App">

<div className="main">

        <div className="center">
          <div className="menu">

            <div className="logo">
              <h3>JONNYWF</h3>
           </div>

           <div className="item-menu">
             <a href="https://api.whatsapp.com/send?phone=5571999697820&text=Ol%C3%A1%2C%20vim%20pela%20sua%20p%C3%A1gina" target="_blank" >Contato</a> 
           </div>

           </div>


            </div>

      </div>

      <div className="presentation">
        <h1>Quem sou eu ?</h1>

      </div>

      <a class="whatsapp-link"  href="https://api.whatsapp.com/send?phone=5571999697820&text=Ol%C3%A1%2C%20vim%20pela%20sua%20p%C3%A1gina" target="_blank">
        <i class="fa fa-whatsapp"></i>
      </a>

    <Conteudo/>

    < Form/>

    <Rodape/>

    </div>

  );
}

export default App;
